import React,{Component} from "react";
import './Project_one.css';
import img from './portfolioss.png';

class Project_one extends Component {
    render() {
        return(
            <div className="Main-Project_one">
                <img src={img} alt="Portfolio_ss_here" width={"370px"} height={"230px"}/>
                <div className="Project_one_text">
                <h2><b>My Portfolio</b></h2>
                <p>Portfolio is a design that speaks for me. It is created with the help of languages like React JS, CSS etc.</p></div>
            </div>
        )
    }
}

export default Project_one;
